import React, { Component } from "react";

import { Link } from "react-scroll";
import classes from "./Navbar.module.css";

// import logo from '../../../assets/img/logo.png';

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      linksActiveClasses: classes.active,
      navBarClasses: classes.Navbar,
      sticky: true
    };
  }

  toggleStickyNav() {
      const oldStickyState = this.state.sticky;
      if (oldStickyState === true) {
        this.setState({sticky:false});
      } else {
        this.setState({sticky:false}); 
      }
  }

  render() {
    let links = this.props.links.map((el, index) => (
      <li className={classes.navItem} key={index}>
        <Link
          activeClass={this.state.sticky ? classes.stickyActive : classes.active}
          to={el.target}
          spy={true}
          smooth={true}
          offset={-72}
          duration={500}
        >
          {el.text}
        </Link>
      </li>
    ));
    return (
      <div className={this.state.sticky ? `${classes.Navbar} ${classes.sticky}` : classes.Navbar}>
        <nav>
          {/* <img src={logo} alt="Logo" className={classes.logo}></img> */}
          <ul className={classes.navItems}>{links}</ul>
        </nav>
      </div>
    );
  }
}

export default Navbar;
